import React, {PureComponent} from 'react';
import {
    WriterWrapper,
    WriterTitle,
    WriterSwitch,
    WriterList,
    WriterItem
} from '../style';

class Writer extends PureComponent {
    render(){
        return(
            <WriterWrapper>
            <WriterTitle>
                推荐作者  
                <WriterSwitch>
                <span className="iconfont">&#xe601;</span>
                    换一批
                </WriterSwitch>
            </WriterTitle>
            <WriterList>
               <WriterItem></WriterItem> 
            </WriterList>  
                Writer~
            </WriterWrapper>
        )
    }
}

export default Writer;
